// SPDX-License-Identifier: MIT

pragma solidity >=0.6.12;
pragma experimental ABIEncoderV2;

import "../openzeppelin/contracts/token/ERC20/ERC20.sol";
import "../openzeppelin/contracts/math/SafeMath.sol";
import "../openzeppelin/contracts/access/Ownable.sol";
import '../libraries/TransferHelper.sol';
import "../interface/IFund.sol";
import "../interface/IRisk.sol";
import "../interface/ISwapTrade.sol";
import "../interface/IMine.sol";
import "../interface/IPoolFactory.sol";

contract TeemoPool is ERC20("TMOLP", "TMOLP"), Ownable {
    using SafeMath for uint256;

    address public tokenAddr;
    address public mainnetTokenAddr;
    address public poolFactoryAddr;
    address public quoteFactoryAddr;

    // mapping(string => address) public allModuleInfo;

    // address public fundAddr;
    // address public riskAddr;
    // address public swapTradeAddr;
    // address public mineAddr;

    event OpenLimitSwap(bytes32 indexed orderID, uint256 indexed openPrice);
    event CancelLimitSwap(uint256 indexed tokenAmount);
    event TradeLimitSwap(address indexed success,uint256 indexed tokenAmount, uint256 time);
    event OpenMarketSwap(bytes32 indexed orderID, string symbol, uint256 indexed openPrice, uint256 time);
    event CloseMarketSwap(bytes32 indexed orderID, string symbol, address userAddr, uint256 indexed closePrice,uint256 indexed plFlag,uint256 plAmount, uint256 time);
    event CloseLimitSwap(address indexed userAddr,uint256 indexed closePrice,uint256 indexed closeType,uint256 plFlag,uint256 plAmount);
    event UpdateSwap(uint256 indexed pLimitPrice, uint256 indexed lLimitPrice);
    event FailedCloseLimitSwap(bytes32[] indexed orderIDs);
    event FailedTradeLimitSwap(bytes32[] indexed orderIDs);

    event LPDeposit(address _userAddr,uint256 indexed lpAmount,uint256 indexed teemoTokenAmount);
    event LPWithdraw(address _userAddr,uint256 indexed tokenAmount);
    event StartMine(address _userAddr,uint256 indexed tokenAmount,uint256 indexed teemoTokenAmount);
    event StopMine(address _userAddr,uint256 indexed tokenAmount,uint256 indexed teemoTokenAmount);

    event SetOrderPrice(address indexed userAddr, bytes32 indexed _orderID, uint256 indexed _price, uint256 time);
    event EmergencyWithdraw(address indexed tokenAddr, address indexed userAddr, uint256 indexed amount);

    function initialize(address _tokenAddr, address _mainnetTokenAddr, address _poolFactoryAddr, address _quoteFactoryAddr) public onlyOwner{
        tokenAddr = _tokenAddr;
        mainnetTokenAddr = _mainnetTokenAddr;
        poolFactoryAddr = _poolFactoryAddr;
        quoteFactoryAddr = _quoteFactoryAddr;
    }

    // function setModuleAddr(string memory _moduleName,address _moduleAddr) public onlyOwner {
    //     allModuleInfo[_moduleName] = _moduleAddr;
    //     if(keccak256(bytes(_moduleName)) == keccak256(bytes("FUND"))){
    //         fundAddr = getModuleAddr(_moduleName);
    //     }else if(keccak256(bytes(_moduleName)) == keccak256(bytes("RISK"))){
    //         riskAddr = getModuleAddr(_moduleName);
    //     }else if(keccak256(bytes(_moduleName)) == keccak256(bytes("SWAPTRADE"))){
    //         swapTradeAddr = getModuleAddr(_moduleName);
    //     }else if(keccak256(bytes(_moduleName)) == keccak256(bytes("MINE"))){
    //         mineAddr = getModuleAddr(_moduleName);
    //     }
    // }

    // modifier onlyNotEmergency() {
    //     bool emergency = IPoolFactory(poolFactoryAddr).getEmergency();
    //     require(emergency == false, "Emergency Condition");
    //     _;
    // }

    function getModuleAddr(string memory _moduleName) public view returns (address moduleAddr) {
        moduleAddr = IPoolFactory(poolFactoryAddr).getPoolModuleAddr(address(this), _moduleName);
    }

    function getQuoteFactoryAddr() public view returns(address) {
        return quoteFactoryAddr;
    }

    // LP充值
    function lpDeposit(uint256 _tokenAmount,bool mine) public {
        TransferHelper.safeTransferFrom(tokenAddr,msg.sender,address(this), _tokenAmount);
        uint256 lpAmount = IFund(getModuleAddr("FUND")).deposit(msg.sender, _tokenAmount);
        if(mine == false){
            _mint(msg.sender,lpAmount);
            emit LPDeposit(msg.sender, lpAmount, 0);
        }else{
            _mint(address(this),lpAmount);
            uint256 userTeemoTokenAmount = _mineType(true, msg.sender, lpAmount);
            emit LPDeposit(msg.sender, lpAmount, userTeemoTokenAmount);
        }    
    }

    // LP参与挖平台币
    function startMine(uint256 _lpAmount) public {
        TransferHelper.safeTransferFrom(address(this),msg.sender,address(this), _lpAmount);
        uint256 userTeemoTokenAmount = _mineType(true, msg.sender, _lpAmount);
        emit StartMine(msg.sender, _lpAmount, userTeemoTokenAmount);
    }

    // LP提现
    function lpWithdraw(uint256 _lpAmount) public {  
        TransferHelper.safeTransferFrom(address(this),msg.sender,address(this),_lpAmount);
        uint256 tokenAmount = IFund(getModuleAddr("FUND")).withdraw(msg.sender, _lpAmount);
        _burn(address(this),_lpAmount);// 销毁lptoken
        TransferHelper.safeTransfer(tokenAddr,msg.sender,tokenAmount);
        emit LPWithdraw(msg.sender, tokenAmount);
    }

    // LP退出挖平台币
    function stopMine(uint256 _lpAmount) public {
        TransferHelper.safeTransfer(address(this),msg.sender,_lpAmount);
        uint256 userTeemoTokenAmount = _mineType(false, msg.sender, _lpAmount);
        emit StopMine(msg.sender, _lpAmount, userTeemoTokenAmount);
    }

    function _mineType(bool _mine, address _userAddr, uint256 _lpAmount) internal returns(uint256 userTeemoTokenAmount){
        uint256 teemoTokenAmount;
        if(_mine){
            (teemoTokenAmount, userTeemoTokenAmount) = IMine(getModuleAddr("MINE")).deposit(_userAddr,_lpAmount); // 开始挖矿
        }else{
            (teemoTokenAmount, userTeemoTokenAmount) = IMine(getModuleAddr("MINE")).withdraw(_userAddr,_lpAmount); //退出挖矿
        }
        if(IPoolFactory(poolFactoryAddr).getStatus()){
            IPoolFactory(poolFactoryAddr).mintToken(teemoTokenAmount);
            IPoolFactory(poolFactoryAddr).safeTeemoTransfer(_userAddr,userTeemoTokenAmount);
        }
        IPoolFactory(poolFactoryAddr).updateBonus(0, _userAddr,userTeemoTokenAmount);
    }

    // 永续合约创建限价单
    function openLimitSwap(string memory _symbol,uint256 _limitPrice,uint256 _tokenAmount,uint256 _lever,uint256 _bsFlag,uint256 _pLimitPrice,uint256 _lLimitPrice) public {
        _feeReceive();
        IPoolFactory(poolFactoryAddr).updateBonus(1, msg.sender,0);
        TransferHelper.safeTransferFrom(tokenAddr,msg.sender,address(this),_tokenAmount);
        (bytes32 orderID, uint256 openPrice) = ISwapTrade(getModuleAddr("SWAPTRADE")).openLimitSwap(msg.sender,_symbol,_limitPrice,_tokenAmount,_lever,_bsFlag,_pLimitPrice,_lLimitPrice);
        emit OpenLimitSwap(orderID, openPrice);
    }

    // 永续合约取消限价单
    function cancelLimitSwap(bytes32 _orderID) public {
        uint256 tokenAmount = ISwapTrade(getModuleAddr("SWAPTRADE")).cancelLimitSwap(msg.sender,_orderID);
        TransferHelper.safeTransferFrom(tokenAddr,msg.sender,address(this),tokenAmount);
        emit CancelLimitSwap(tokenAmount);
    }

    // 永续合约成交限价单
    function tradeLimitSwaps(bytes32[] memory _orderIDs) public {
        (bool status, uint256 _blockIndex) = ISwapTrade(getModuleAddr("SWAPTRADE")).isValidating(_orderIDs);
        if(status){
            for(uint256 i=0;i<_orderIDs.length;i++){
                tradeLimitSwap(_orderIDs[i],_blockIndex);
            }
        }else{
            emit FailedTradeLimitSwap(_orderIDs);
        }
    }

    function tradeLimitSwap(bytes32 _orderID,uint256 _blockIndex) public {
        (bool success,address userAddr,uint256 tokenAmount, uint256 openPrice, string memory symbol, uint256 bsFlag) = ISwapTrade(getModuleAddr("SWAPTRADE")).tradeLimitSwap(_orderID,_blockIndex);
        if(success){
            _riskOrder(0, openPrice, symbol, bsFlag, tokenAmount);
            emit TradeLimitSwap(userAddr,tokenAmount, block.timestamp);
        }
    }        

    // 永续合约市价建仓
    function openMarketSwap(string memory _symbol,uint256 _tokenAmount,uint256 _lever,uint256 _bsFlag,uint256 _pLimitPrice,uint256 _lLimitPrice, uint256 _maxPrice) public {
        _feeReceive();
        IPoolFactory(poolFactoryAddr).updateBonus(1, msg.sender, 0);
        TransferHelper.safeTransferFrom(tokenAddr,msg.sender,address(this),_tokenAmount);
        (bytes32 orderID, uint256 openPrice) = ISwapTrade(getModuleAddr("SWAPTRADE")).openMarketSwap(msg.sender,_symbol,_tokenAmount,_lever,_bsFlag,_pLimitPrice,_lLimitPrice, _maxPrice);
        if(openPrice > 0) {
            _riskOrder(0, openPrice, _symbol, _bsFlag, _tokenAmount);
        }
        emit OpenMarketSwap(orderID, _symbol,openPrice, block.timestamp);
    }

    // 永续合约市价平仓
    function closeMarketSwap(bytes32 _orderID) public {
        _closeMarketSwap(msg.sender, _orderID);
    }

    // 自动平仓(止盈止损强平)
    function closeLimitSwaps(bytes32[] memory _orderIDs) public {
        (bool status, uint256 _blockIndex) = ISwapTrade(getModuleAddr("SWAPTRADE")).isValidating(_orderIDs);
        if(status) {
            for(uint256 i=0;i<_orderIDs.length;i++){
                closeLimitSwap(_orderIDs[i],_blockIndex);
            }
        }else{
            emit FailedCloseLimitSwap(_orderIDs);
        }
    }

    function closeLimitSwap(bytes32 _orderID,uint256 _blockIndex) public {
        (bool success,address userAddr,uint256 closePrice,uint256 closeType,uint256 plFlag, uint256 bsFlag, uint256 plAmount,uint256 tradeAmount, string memory symbol) = ISwapTrade(getModuleAddr("SWAPTRADE")).closeLimitSwap(_orderID,_blockIndex);
        if(success){
            _closeSwap(closePrice, symbol, bsFlag, userAddr, plFlag, plAmount, tradeAmount);
            emit CloseLimitSwap(userAddr,closePrice,closeType,plFlag,plAmount);
        }
    }

    // 永续合约订单更新止盈止损根据价格
    function updateSwapByPrice(bytes32 _orderID,uint256 _pLimitPrice,uint256 _lLimitPrice) public {
        (uint256 pLimitRate,uint256 lLimitRate) = ISwapTrade(getModuleAddr("SWAPTRADE")).updateSwapByPrice(msg.sender, _orderID,_pLimitPrice,_lLimitPrice);
        emit UpdateSwap(pLimitRate, lLimitRate);
    }

    // 永续合约订单更新止盈止损根据比例
    function updateSwapByRate(bytes32 _orderID,uint256 _pLimitRate,uint256 _lLimitRate) public {
        (uint256 pLimitPrice,uint256 lLimitPrice) = ISwapTrade(getModuleAddr("SWAPTRADE")).updateSwapByRate(msg.sender, _orderID,_pLimitRate,_lLimitRate);
        emit UpdateSwap(pLimitPrice, lLimitPrice);
    }

    // 设置订单价格
    function setOpenPrice(bytes32 _orderID) public onlyOwner{
        (address userAddr, uint256 openPrice, string memory symbol, uint256 bsFlag, uint256 tokenAmount) = ISwapTrade(getModuleAddr("SWAPTRADE")).setOrderPrice(_orderID);
        _riskOrder(0, openPrice, symbol, bsFlag, tokenAmount);
        emit SetOrderPrice(userAddr, _orderID, openPrice, block.timestamp);
    } 

    // 更新价格后平仓
    function closeMarketByOwner(address _userAddr, bytes32 _orderID) public onlyOwner {
        _closeMarketSwap(_userAddr, _orderID);
    }

    function setValidBlocks(uint256 _valideBlocks) public onlyOwner {
        ISwapTrade(getModuleAddr("SWAPTRADE")).setValidBlocks(_valideBlocks);
    }

    function updateTicker(string memory _symbol, uint256 _price) public onlyOwner {
        IRisk(getModuleAddr("RISK")).ticker(_symbol, _price);
    }

    function emergencyWithdraw(address _tokenAddr, address _to, uint256 _amount) public onlyOwner {
        TransferHelper.safeTransfer(_tokenAddr, _to, _amount);
    }

    function _closeMarketSwap(address _userAddr, bytes32 _orderID) internal {
        (uint256 closePrice,uint256 plFlag, uint256 bsFlag, uint256 plAmount,uint256 tradeAmount, string memory symbol) = ISwapTrade(getModuleAddr("SWAPTRADE")).closeMarketSwap(_userAddr, _orderID);
        _closeSwap(closePrice, symbol, bsFlag, _userAddr, plFlag, plAmount, tradeAmount);
        emit CloseMarketSwap(_orderID, symbol, _userAddr, closePrice, plFlag, plAmount, block.timestamp);
    }

    function _closeSwap(uint256 _closePrice, string memory _symbol, uint256 _bsFlag, address _userAddr, uint256 _plFlag, uint256 _plAmount, uint256 _tradeAmount) internal {
        address fundAddr = getModuleAddr("FUND");
        IFund(fundAddr).tradePL(_plFlag, _plAmount);
        if(_closePrice > 0) {
            _riskOrder(1, _closePrice, _symbol, _bsFlag, _tradeAmount);
        }
        if(IPoolFactory(poolFactoryAddr).getStatus()){
            if(_plFlag == 1){// 交易用户盈利了
                TransferHelper.safeTransfer(tokenAddr,_userAddr,_tradeAmount.add(_plAmount));
            }else{
                TransferHelper.safeTransfer(tokenAddr,_userAddr,_tradeAmount.sub(_plAmount));
            }
        }else{
            TransferHelper.safeTransfer(tokenAddr,_userAddr,_tradeAmount);
        }
        if(_plFlag == 1){
            IPoolFactory(poolFactoryAddr).updateBonus(2, _userAddr,_plAmount);
        }
    }

    function _riskOrder(uint8 _riskType, uint256 _price, string memory _symbol, uint256 _bsFlag, uint256 _tokenAmount) internal {
        bool longOrder = false;
        if(_bsFlag == 1){
            longOrder = true;
        }
        if(_riskType == 0){
            IRisk(getModuleAddr("RISK")).createOrder(_symbol, longOrder, _price, _tokenAmount);
        }else{
            IRisk(getModuleAddr("RISK")).closeOrder(_symbol, longOrder, _price, _tokenAmount);
        }
    }

    function _feeReceive() internal {
        uint256 fee = IPoolFactory(poolFactoryAddr).getOpenFee();
        require(msg.value >= fee, "_feeReceive: insufficent for fee");
        address payable receiver = IPoolFactory(poolFactoryAddr).getFeeReceiver();
        TransferHelper.safeTransferETH(receiver,fee);
    }

}
